import React from 'react';
import { AppBar, Tabs, Tab } from '@material-ui/core';
const Appbar = () => {
    return (
        <AppBar title="My App">
            <Typography variant="h6" className={classes.title}>
                Expense Tracker
            </Typography>
            <Tabs>
                <Tab label="Item 1" />
                <Tab label="Item 2" />
                <Tab label="Item 3" />
                <Tab label="Item 4" />
            </Tabs>
        </AppBar>
    )
}

export default Appbar;
